                    <p><b>Dwarf remains</b> are a <a href=""/w/Quest_item"" class=""mw-redirect"" title=""Quest item"">quest item</a> in the <a href=""/w/Dwarf_Cannon"" title=""Dwarf Cannon"">Dwarf Cannon</a> <a href=""/w/Quest"" class=""mw-redirect"" title=""Quest"">quest</a>, and the skeletal remains of <a href=""/w/Gilob"" title=""Gilob"">Gilob</a>, a <a href=""/w/Dwarf"" title=""Dwarf"">dwarf</a> killed while on the lookout for <a href=""/w/Goblins"" class=""mw-redirect"" title=""Goblins"">goblins</a>. The player discovers the remains in the top floor of the watchtower south of the quest starting point. They must be given to <a href=""/w/Captain_Lawgof"" title=""Captain Lawgof"">Captain Lawgof</a>.
                    </p>
